import React from 'react'

function Homelogo({ Icon, tittle}) {
    return (
        <div className="homepage">
           <div style={{width:'20px',backgroundColor:'bl'}}>
               <Icon className="logodiv"/> </div>
            <h4>{tittle}</h4>
        </div>
    )
}

export default Homelogo
